import { observable, action } from 'mobx';
import axios from 'axios';

class CCsStore {
  @observable ccs = {};

  @action
  getDetails() {
    axios
      .get(`https://fakerapi.it/api/v1/credit_cards?_quantity=1`)
      .then(function (response) {
        console.log(response.data.data[0]);
        this.ccs = new CCStore(
          response.data.data[0].type,
          response.data.data[0].owner,
          response.data.data[0].number,
          response.data.data[0].expiration,
        );
        /*  response.data.data[0].type = type;
        response.data.data[0].owner = owner;
        response.data.data[0].number = number;
        response.data.data[0].expiration = expiration;
 */
        console.log(
          response.data.data[0].type,
          response.data.data[0].owner,
          response.data.data[0].number,
          response.data.data[0].expiration,
        );
      })
      .catch(function (error) {
        console.log(error);
      });
  }
}

class CCStore {
  @observable type = '';
  @observable owner = '';
  @observable number = '';
  @observable expiration = '';

  constructor(type, number, owner, expiration) {
    this.type = type;
    this.number = number;
    this.owner = owner;
    this.expiration = expiration;
  }
}

export default CCsStore;
